import logo from './logo.svg';
import './App.css';
import SearchScreen from './components/search-screen';
import DetailsScreen from './components/details-screen';

function App() {
  return (
    <div className="App">
      <h1>
        Student and Class Tracker
      </h1>
      <SearchScreen/>
      <DetailsScreen/>
    </div>
  );
}

export default App;
